import React from 'react';

function App() {
  return <Component7 {...component7Data} />;
}

export default App;

function Component7(props) {
  const {
    title,
    place,
    yourRole,
    getConnected,
    notificationBell,
    shareSquare180Ro,
    placeholderAvatar,
    faUserCircle,
  } = props;

  return (
    <div className="component-7">
      <div className="logo">
        <div className="burger-menu">
          <h1 className="title valign-text-middle">{title}</h1>
        </div>
      </div>
      <div className="overlap-group2">
        <div className="place valign-text-middle">{place}</div>
      </div>
      <div className="overlap-group">
        <div className="your-role valign-text-middle inter-medium-royal-blue-16px">{yourRole}</div>
      </div>
      <div className="overlap-group1">
        <div className="get-connected valign-text-middle inter-medium-royal-blue-16px">{getConnected}</div>
      </div>
      <div className="notification-bell valign-text-middle fontawesome5free-regular-normal-silver-24px">
        {notificationBell}
      </div>
      <div className="share-square-180-ro valign-text-middle fontawesome5free-regular-normal-silver-24px">
        {shareSquare180Ro}
      </div>
      <img className="placeholder-avatar" src={placeholderAvatar} />
      <div className="fa-user-circle valign-text-middle">{faUserCircle}</div>
    </div>
  );
}

const component7Data = {
    title: "bars",
    place: "Home",
    yourRole: "Your role",
    getConnected: "Get connected",
    notificationBell: "",
    shareSquare180Ro: "question-circle",
    placeholderAvatar: "https://anima-uploads.s3.amazonaws.com/projects/60945387f79955c69361f394/releases/6094544246fdaea7feb7db1b/img/placeholder---avatar@2x.svg",
    faUserCircle: "chevron-down",
};
